import React from 'react'
import { StyleSheet, Text, View } from 'react-native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import LogIn from '../pages/LogIn';
import SignIn from '../pages/SignIn';
import PassRecover from '../pages/PassRecover';
import DrawerRoutes from './DrawerRoutes';
import Inicio from '../pages/Inicio';

export default function Routes() {

    const Stack = createNativeStackNavigator()

  return (
    <Stack.Navigator>
            <Stack.Screen name="Inicio" component={Inicio} options={{
        headerStyle:{backgroundColor:'#46696E', borderBottomRightRadius:10,
        borderBottomLeftRadius:10, borderTopLeftRadius:10,borderTopRightRadius:10, }, headerTitleStyle:{fontSize:30, fontWeight:'bold'}
      }}/>
        <Stack.Screen name='LogIn' component={LogIn} />
        <Stack.Screen name='SignIn' component={SignIn} />
        <Stack.Screen name='PassRecover' component={PassRecover} />
        <Stack.Screen name="DrawerRoutes" component={DrawerRoutes} options={{headerShown: false }}/>
    </Stack.Navigator>
  );
}
